import bisect

class MyCalendarThree(object):

    def __init__(self):
        self.timeline = []

    def book(self, start, end):
        bisect.insort(self.timeline, (start, 1))
        bisect.insort(self.timeline, (end, -1))
        active = 0
        max_active = 0
        for time, delta in self.timeline:
            active += delta
            max_active = max(max_active, active)
        return max_active
